sp_rename 'zz_import_insurance_20100225', 'zz_import_insurancePlan_20100225' 

SELECT [PAYOR NAME]
  ,[PAYOR ADDRESS 1]
  ,[PAYOR ADDRESS 2]
  ,[PAYOR CITY]
  ,[PAYOR ST]
  ,[PAYOR ZIP]
  ,[PAYOR PHONE]
  ,[PAYOR FAX]
	, min(rowID) as rowID
into [zz_import_insurance_20100225]
FROM [dbo].zz_import_insurancePlan_20100225
group by
[PAYOR NAME]
  ,[PAYOR ADDRESS 1]
  ,[PAYOR ADDRESS 2]
  ,[PAYOR CITY]
  ,[PAYOR ST]
  ,[PAYOR ZIP]
  ,[PAYOR PHONE]
  ,[PAYOR FAX]
GO



alter table [zz_import_insurance_20100225] add rowId int identity(1,1)
alter table zz_import_insurancePlan_20100225 add insuranceCompanyID int
GO


update zz
set insuranceCompanyID=ic.insuranceCompanyID
from [zz_import_insurance_20100225] z
	inner join insuranceCompany ic
		on 'Id:' + cast(z.rowID as varchar) =cast(ic.notes as varchar(255))
	inner join zz_import_insurancePlan_20100225 zz
		on zz.[PAYOR NAME]=z.[PAYOR NAME]
		and isnull(zz.[PAYOR ADDRESS 1], '')=isnull(z.[PAYOR ADDRESS 1], '')
		and isnull(zz.[PAYOR ADDRESS 2], '')=isnull(z.[PAYOR ADDRESS 2], '')
		and isnull(zz.[PAYOR CITY], '')=isnull(z.[PAYOR CITY], '')
		and isnull(zz.[PAYOR ST], '')=isnull(z.[PAYOR ST], '')
		and isnull(zz.[PAYOR ZIP], '')=isnull(z.[PAYOR ZIP], '')
		and isnull(zz.[PAYOR PHONE], '')=isnull(z.[PAYOR PHONE], '')




select * from insuranceCompany

update [zz_import_insurance_20100225]
set [PAYOR PHONE]=replace([PAYOR PHONE], '-', '' )



	select distinct
	'exec [dbo].[InsurancePlanDataProvider_CreateInsuranceCompany]
		@name = ''' + replace([PAYOR NAME], '', '''''') + ''',
		@street_1 = ''' + isnull([PAYOR ADDRESS 1], '') + ''',
		@street_2 = ''' +isnull([PAYOR ADDRESS 2], '')+ ''',
		@city =''' + isnull([PAYOR CITY], '')+ ''',
		@state = ''' + isnull([PAYOR ST], '')+ ''',
		@zip = ''' + isnull([PAYOR ZIP], '')+ ''',
		@contact_prefix = NULL,
		@contact_first_name = NULL,
		@contact_middle_name = NULL,
		@contact_last_name = NULL,
		@contact_suffix = NULL,
		@phone = ''' + isnull([PAYOR PHONE], '')+ ''',
		@phone_x = ''' + isnull([PAYOR FAX], '')+ ''',
		@fax = null,
		@fax_x = null,
		@program_code = ''CI'',
		@notes = ''Id:' + cast(rowid as varchar(32)) + ''',
		@practice_id = null,
		@BillingFormID = 13,
		@SecondaryPrecedenceBillingFormID =13,
		@AcceptAssignment = 0,
		@UseSecondaryElectronicBilling = 0,
		@UseCoordinationOfBenefits = 1,
		@ExcludePatientPayment = 0,
		@bill_secondary_insurance = 0,
		@review_code=''R'',
		@UseFacilityID=''1'',
		@eclaims_disable=0,
		@country=''USA''
	'
	from dbo.[zz_import_insurance_20100225] z
	where [PAYOR NAME] is not null
		-- and not exists( select * from insuranceCompany icp where z.InsuranceCompanyName=icp.insuranceCompanyName and icp.practiceID=z.practiceID)
	order by 1
	
	
